import React, { Component } from 'react';
import './Dictionary.css';

class Dictionary extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {

        return (
            <div className="Dictionary">
                <div>{this.props.item.name}</div>
            </div>
        );
    }
}

export default Dictionary;
